import React from 'react';
import Navbar from './Navbar'; // Adjust the import path as necessary

const Layout = ({ cartItemCount, children }) => {
  return (
    <>
      <Navbar cartItemCount={cartItemCount} />
      <div>{children}</div>
    </>
  );
};

export default Layout;
